    }

    return (
        <>
            <div className="second_form_main">
                <form onSubmit={onSubmit} className="second_form">
                    <h1>Complex Form</h1>
                    <input type="text"
                        placeholder="enter your name"
                    />
                    <input type="email"
                        placeholder="Enter your email"
                    />
                    <input type="number"
                        placeholder="Enter your Contact detail"
                    />
